import React, {Component} from 'react';
import './App.css';
import axios from 'axios'

import Dashboard from './Components/Dashboard/Dashboard';
import Form from './Components/Form/Form';
import Header from './Components/Header/Header';

export default class App extends Component {
  constructor(){
    super();

    this.state = {
      inventory: [
        // {name:'Honda Civic Type R', price:37500, image_url:'data:image/jpeg;base64,'},
        // {name:'Mustang GT', price:47500, image_url:'data:image/jpeg;base64,'},
        // {name:'Jeep Gladiator', price:50000, image_url:'data:image/jpeg;base64,'}
      ],
      selectedProduct: {}
    }
    this.getInventory = this.getInventory.bind(this)
  }


  componentDidMount = () =>{
    this.getInventory();
    console.log('attempting to mount')
  }

  getInventory(){
    axios.get('/api/inventory').then((response)=>{
      this.setState({inventory: response.data})
    })
  }

  handleEditProduct = (prod) => {
    this.setState({
      selectedProduct: prod
    })
  }


  render() {
    return (
    <div className="App">
      <Header/>
      <Dashboard inventory = {this.state.inventory} getInventory = {this.getInventory} edit = {this.handleEditProduct} />
      <Form getInventory = {this.getInventory} selected = {this.state.selectedProduct} />
    </div>
    ) 
  };
}


